import React from 'react'
import { jsPDF } from "jspdf";
import "jspdf-autotable"
const JspdfInvoice = ({ data }) => {
  const handleImageError = (e) => {
    console.error("Image failed to load", e);
    e.target.style.display = "none";
  };


  function monthNameToNumber(monthName) {
    const months = [
      "January",
      "February",
      "March",
      "April",
      "May",
      "June",
      "July",
      "August",
      "September",
      "October",
      "November",
      "December",
    ];
    const monthIndex = months.findIndex(
      (m) => m.toLowerCase() === monthName.toLowerCase()
    );
    return monthIndex !== -1 ? monthIndex + 1 : null;
  }

  function getLastDateOfMonth(monthName) {
    const monthNumber = monthNameToNumber(monthName);
    if (monthNumber === null) {
      return "Invalid month name";
    }
    const currentYear = new Date().getFullYear();
    const lastDate = new Date(currentYear, monthNumber, 0).getDate();
    const formattedMonth = monthNumber < 10 ? '0' + monthNumber : monthNumber;
    const formattedLastDate = lastDate < 10 ? '0' + lastDate : lastDate;
    return `${currentYear}-${formattedMonth}-${formattedLastDate}`;
  }


  const doc = new jsPDF();
  const handelrightalign = (text, size) => {
    return doc.internal.pageSize.width - (doc.getStringUnitWidth(text) * size / doc.internal.scaleFactor) - 15
  }
  const invoiceNo = data?.invoice_no;
  const invoiceDate = getLastDateOfMonth(data?.month);
  const email = data?.user_email_id;
  const phone = data?.user_contact_no;
  const name = data?.user_name;
  const block = data?.permanent_address;
  const statecity = data?.permanent_city + " , " + data?.permanent_state;
  const pincode1 = permanent_pin_code;

  const imge = "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAEMgAAAOxCAYAAAAeayzBAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAIOrSURBVHgB7N1PbJRnnuDxx3 + BGZfPcTzquYwZOGIJpD0MLQ054QvuQ + ASIw2c1h6FW0I2e5pM3PSJKPYNj4T3Ajm0uZjDKqwU5kZLcMSL5zKtdZwz5e7gf3j9FONOSFyO633KVU9VfT5SiW4MuOp5n /  + ";
  var width = doc.internal.pageSize.getWidth();

  doc.addImage(imge, "PNG", 0, 0, width, 50);

  // Set fill and text colors
  doc.setFillColor(0); // Black color
  doc.setTextColor(0); // Gray color

  doc.setFont('helvetica', 'bold'); // Set font style to bold
  // Add Invoice No and Date on the right side
  doc.setFontSize(12);
  doc.text('Invoice No:', doc.internal.pageSize.width - 70, 30);
  doc.text('Invoice Date:', doc.internal.pageSize.width - 70, 40);
  doc.setTextColor("#505050");
  doc.text(invoiceNo, handelrightalign("#DI56789", 12), 30); // Black color and bold
  doc.text(invoiceDate, handelrightalign("15/12/2024", 12), 40); // Black color and bold
  doc.setTextColor(0); // Gray color

  doc.text('Info:', 10, 60);
  doc.text('Invoice To:', handelrightalign('Invoice to: ', 12), 60);
  doc.setTextColor('#1D4ED8')
  doc.setFontSize(16);
  doc.text('Jordon Smith', 10, 70);
  var invoiceToName = "Digital Invoica";
  var fontSize = 16; // Adjust as needed
  var x = handelrightalign(invoiceToName, fontSize);

  doc.text(name, x, 70);
  doc.setTextColor('#505050')
  doc.setFontSize(16);
  doc.setFont('helvetica', 'regular');
  doc.text(block, 10, 78);
  doc.text(statecity, 10, 86);
  doc.text(pincode1, 10, 94);
  doc.text(email, 10, 102);

  var street = "105,  Gravity Mall, Vijay Nagar"
  var city = "Indore, Madhya Pradesh"
  var pincode = "452010- India"
  var Gst = "GSTIN: 23AABCD1234A1Z8"
  doc.text(street, handelrightalign(street, 16), 78);
  doc.text(city, handelrightalign(city, 16), 86);

  doc.text(pincode, handelrightalign(pincode, 16), 94);
  doc.text(Gst, handelrightalign(Gst, 16), 102);

  const headers = [['Description', 'Price', 'Total']]; // Table headers
  const invoicetable = [
    [data?.billing_header_name, data?.net_salary, data?.net_salary],

  ]; // Table data

  // Set font style for table
  doc.setFont('helvetica', 'regular');
  // doc.setTextColor('#000000'); // Text color
  doc.setFillColor('#000000');
  // Generate table
  const styles = {
    rows: {
      row1: {
        fontSize: 14,
      },
    },
  };
  doc.autoTable({
    head: headers,
    headStyles: {
      fillColor: [0, 0, 0]
    },
    body: invoicetable,
    startY: 110,// Adjust vertical position of the table

  });

  doc.setFillColor(0); // Black color
  doc.setTextColor(0); // Gray color

  doc.setFont('helvetica', 'bold');
  // Add Invoice No and Date on the right side
  doc.setFontSize(12);
  doc.text('Sub Total:', doc.internal.pageSize.width - 70, 110 + 15 * data.length);
  doc.text('TDS', doc.internal.pageSize.width - 70, 120 + 15 * data.length);
  doc.setTextColor("#505050")
  const subtotal = data?.net_salary;
  const tds_deduction = data?.tds_deduction;
  doc.text(subtotal, handelrightalign(subtotal, 12), 110 + 15 * data.length); // Black color and bold
  doc.text(tds_deduction, handelrightalign(tds_deduction, 12), 120 + 15 * data.length); // Black color and bold

  var amt1 = subtotal - tds_deduction;
  var amt = `Grand Total: Rs. ${amt1}`
  doc.setFillColor('#000000'); // Black color
  doc.setFontSize(14)
  doc.text(amt, handelrightalign(amt, 14), 130 + 15 * data.length);
  var footer = "data:image/png;base64,";
  const details = [data?.beneficiary_name, data?.bank_name, data?.account_no, data?.ifsc_code, data?.pan_no];
  const longestlen = (fontSize) => {

    const maxIndex = details.reduce((maxIndex, str, i, arr) => str.length > arr[maxIndex].length ? i : maxIndex, 0);
    return doc.getStringUnitWidth(details[maxIndex]) * fontSize / doc.internal.scaleFactor

  }
  doc.addImage(footer, "PNG", 0, 140 + 15 * data.length, width, 50);
  doc.setTextColor('#1D4ED8')
  var fontSize = 16; // Adjust as needed
  doc.setFontSize(fontSize);

  var x = handelrightalign("Account Details", fontSize);

  doc.text("Account Details", x - longestlen(12) - 20, 160 + 15 * data.length);
  doc.setFillColor(0); // Black color
  doc.setTextColor(0); // Gray color

  doc.setFont('helvetica', 'bold');
  // Add Invoice No and Date on the right side
  function findLongestWord(arr) {
    let longestWord = "";

    for (let i = 0; i < arr.length; i++) {
      if (arr[i] && arr[i].length > longestWord.length) {
        longestWord = arr[i];
      }
    }

    return longestWord;
  }
  doc.setFontSize(12);
  doc.text('Benificiary Name:', handelrightalign(findLongestWord(details), 12) - longestlen(12) - 20, 170 + 15 * data.length);
  doc.text('Bank Name:', handelrightalign(findLongestWord(details), 12) - longestlen(12) - 20, 180 + 15 * data.length);
  doc.text('Account No:', handelrightalign(findLongestWord(details), 12) - longestlen(12) - 20, 190 + 15 * data.length);
  doc.text('IFSC Code:', handelrightalign(findLongestWord(details), 12) - longestlen(12) - 20, 200 + 15 * data.length);
  doc.text('PAN No.:', handelrightalign(findLongestWord(details), 12) - longestlen(12) - 20, 210 + 15 * data.length);
  doc.setTextColor("#505050")
  doc.text(details[0], handelrightalign(details[0], 12), 170 + 15 * data.length);
  doc.text(details[1], handelrightalign(details[1], 12), 180 + 15 * data.length);
  doc.text(details[2], handelrightalign(details[2], 12), 190 + 15 * data.length);
  doc.text(details[3], handelrightalign(details[3], 12), 200 + 15 * data.length);
  doc.text(details[4], handelrightalign(details[4], 12), 210 + 15 * data.length);

  var pdfBlob = doc.output('blob');
  console.log(pdfBlob);

  return pdfBlob;
}

export default JspdfInvoice

